import { Link, NavLink } from "react-router-dom";
import JulienPhoto from "../assets/julien_photo.jpeg";
import { useState } from "react";

const Navbar = () => {
  const [isMobileMenuOpen, setMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setMobileMenuOpen(!isMobileMenuOpen);
  };

  const closeMobileMenu = () => {
    setMobileMenuOpen(false);
  };

  return (
    <nav className="bg-gray-50 text-black font-mono">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          {/* Logo and Name */}
          <div className="flex items-center space-x-4">
            <Link to="/" onClick={closeMobileMenu}>
              <img
                className="w-10 h-10 rounded-full hover:scale-110 transition-all duration-300"
                src={JulienPhoto}
                alt="JulienPhoto"
              />
            </Link>
            <div className="flex flex-col md:flex-row items-start md:items-center">
              <Link to="/" className="text-2xl font-bold text-black" onClick={closeMobileMenu}>
                Julien
              </Link>
              <span className="text-sm text-gray-500 md:pl-2">
                Computer Science @ Northeastern University
              </span>
            </div>
          </div>

          {/* Mobile Menu Toggle Button */}
          <button
            className="md:hidden focus:outline-none"
            onClick={toggleMobileMenu}
            aria-label="Toggle Mobile Menu"
          >
            <svg
              className="h-6 w-6 text-gray-800"
              xmlns="http://www.w3.org/2000/svg"
              fill="none"
              viewBox="0 0 24 24"
              stroke="currentColor"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d={
                  isMobileMenuOpen
                    ? "M6 18L18 6M6 6l12 12" // X icon for close
                    : "M4 6h16M4 12h16M4 18h16" // Hamburger menu icon
                }
              />
            </svg>
          </button>

          {/* Desktop Navigation Links */}
          <div className="hidden md:flex items-center space-x-4">
            {[
              { to: "/about-me", label: "About Me" },
              { to: "/resume.png", label: "Resume", external: true },
              { to: "/projects", label: "Projects" },
              { to: "/contact", label: "Contact" },
            ].map((item, index) => (
              <div key={index} className="flex items-center">
                {item.external ? (
                  <a
                    href={item.to}
                    className="px-3 py-2 rounded-md text-sm font-bold hover:bg-teal-500 hover:text-white transition-all duration-300"
                  >
                    {item.label}
                  </a>
                ) : (
                  <NavLink
                    to={item.to}
                    className={({ isActive }) =>
                      isActive
                        ? "px-3 py-2 rounded-md text-sm font-bold bg-teal-500 text-white"
                        : "px-3 py-2 rounded-md text-sm font-bold hover:bg-teal-500 transition-all duration-300 hover:text-white"
                    }
                  >
                    {item.label}
                  </NavLink>
                )}
                {index < 3 && <span className="text-gray-400">|</span>}
              </div>
            ))}
          </div>
        </div>

        {/* Mobile Menu */}
        {isMobileMenuOpen && (
          <div className="md:hidden mt-2 space-y-2 bg-gray-50 rounded-lg shadow-lg p-4">
            {[
              { to: "/about-me", label: "About Me" },
              { to: "/resume.png", label: "Resume", external: true },
              { to: "/projects", label: "Projects" },
              { to: "/contact", label: "Contact" },
            ].map((item, index) => (
              <div key={index} className="flex flex-col">
                {item.external ? (
                  <a
                    href={item.to}
                    className="block px-3 py-2 text-sm font-bold text-gray-800 rounded-md hover:bg-teal-500 hover:text-white transition-all duration-300"
                    onClick={closeMobileMenu}
                  >
                    {item.label}
                  </a>
                ) : (
                  <NavLink
                    to={item.to}
                    className={({ isActive }) =>
                      isActive
                        ? "block px-3 py-2 text-sm font-bold bg-teal-500 text-white rounded-md"
                        : "block px-3 py-2 text-sm font-bold text-gray-800 rounded-md hover:bg-teal-500 hover:text-white transition-all duration-300"
                    }
                    onClick={closeMobileMenu}
                  >
                    {item.label}
                  </NavLink>
                )}
              </div>
            ))}
          </div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
